const RARITY = require('./RARITY');

const RARITY_LEVEL = {
    [RARITY.COMMON]: 0,
    [RARITY.UNCOMMON]: 1,
    [RARITY.RARE]: 2,
    [RARITY.CLASSIC]: 3,
    [RARITY.SKETCH]: 4,
};

module.exports = RARITY_LEVEL;
